void Screen2ViewBase::buttonCallbackHandler(const touchgfx::AbstractButton& src)
{
    if (&src == &Back)
    {
        //Interaction1
        //When Back clicked change screen to Screen1
        //Go to Screen1 with screen transition towards East
        application().gotoScreen1ScreenSlideTransitionEast();
    }
}

void Screen2ViewBase::graphClickedCallbackHandler(const touchgfx::AbstractDataGraph& src, const touchgfx::AbstractDataGraph::GraphClickEvent& value)
{
    if (&src == &graph1)
    {
        //Interaction2
        //When graph1 clicked call virtual function
        //Call FFT_InputCallback
        FFT_InputCallback(value);
    }
    if (&src == &graph2)
    {
        //Interaction3
        //When graph2 clicked call virtual function
        //Call FFT_OutputCallback
        FFT_OutputCallback(value);
    }
}
